import React from 'react';
 
const Languages = () => {
    return (
        <div className="ml-4">
            <h4 className="mb-4 mt-3 per_info_title">languages</h4>
            <ul className="list-unstyled">
                {perInfo.map(e => (
                    <li className="d-flex justify-content-between my-3">
                        <span className="text-uppercase">{e.type}</span>
                        <span className="text-capitalize">{e.inf}</span>
                    </li>
                ))}
            </ul>
        </div>
    );
}
 
 
export default Languages;
